import React from "react";
import styled from "styled-components";

const AboutEc = styled.div`
  font-size: 32px;
  font-family: Kanit;
  font-weight: bold;
  line-height: 48px;
  width: 100%;
  padding-top: 100px;
  padding-bottom: 72px;
`;
function MainAboutEcText() {
  return <AboutEc>AboutEc</AboutEc>;
}

export default MainAboutEcText;
